import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Container from 'react-bootstrap/Container';
import Translations from '../resources/Translations.js';

var bs = [];
 
const key = (i) => {
    return 'key_' + i;
}

const getLength = (count) => {
    return ((12 / count) > 4 ) ? 4 : 12/count;
}

const TopPanel = (props) => {
const buttonsLength = props.buttons.length;
let length = getLength(buttonsLength);

    for (var i = 0; i < buttonsLength; i++) {
        bs.push(
            <Col sm lg={length}>
                    <Button key={key(i)}>{Translations[props.buttons[i]]}</Button>
            </Col>
        );
        console.log(i);
        console.log(buttonsLength);
        console.log(bs);

        }
    return (
        <Container>
            <Row>
                {bs}
            </Row>
        </Container>
    )

}

export default TopPanel;
